import React, { useEffect, useState } from "react";
import { useParams, Link, useNavigate } from "react-router-dom";
import { ExternalLink, GitPullRequest, ChevronRight } from "lucide-react";

export default function PRList() {
  const { owner, repo } = useParams();
  const [prs, setPRs] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    async function fetchPRs() {
      try {
        const res = await fetch(
          `https://api.github.com/repos/${owner}/${repo}/pulls`
        );
        const data = await res.json();
        setPRs(data);
      } catch (err) {
        console.error("Error fetching PRs", err);
      } finally {
        setLoading(false);
      }
    }
    fetchPRs();
  }, [owner, repo]);

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64 text-white/80 animate-pulse">
        Loading PRs...
      </div>
    );
  }

  if (!prs.length) {
    return (
      <div className="flex flex-col items-center justify-center h-64 text-white/70">
        <GitPullRequest className="w-10 h-10 mb-2 animate-bounce" />
        <p>No open PRs found</p>
      </div>
    );
  }

  // Tilt animation
  const handleMouseMove = (e, card) => {
    const rect = card.getBoundingClientRect();
    const x = e.clientX - rect.left - rect.width / 2;
    const y = e.clientY - rect.top - rect.height / 2;
    const rotateX = (-y / 20).toFixed(2);
    const rotateY = (x / 20).toFixed(2);

    card.style.transform = `rotateX(${rotateX}deg) rotateY(${rotateY}deg) scale(1.05)`;
  };

  const handleMouseLeave = (card) => {
    card.style.transform = `rotateX(0deg) rotateY(0deg) scale(1)`;
    card.style.transition = "transform 0.6s cubic-bezier(0.19, 1, 0.22, 1)";
    setTimeout(() => {
      card.style.transition = "";
    }, 600);
  };

  return (
    <section
      className={`grid gap-6 sm:gap-8 grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 
        mx-4 sm:mx-6 lg:mx-12`}
    >
      {prs.map((pr, i) => (
        <article
          key={pr.id}
          className="group relative rounded-xl p-5 md:p-6 bg-white/10 border border-white/10 backdrop-blur-xl 
                     shadow-[0_20px_80px_-20px_rgba(0,0,0,0.55)] 
                     hover:shadow-[0_40px_120px_-20px_rgba(0,0,0,0.65)] 
                     transition-all duration-500 flex flex-col overflow-hidden opacity-0 animate-fadeUp"
          style={{
            animationDelay: `${i * 150}ms`,
            transformStyle: "preserve-3d",
          }}
          onMouseMove={(e) => handleMouseMove(e, e.currentTarget)}
          onMouseLeave={(e) => handleMouseLeave(e.currentTarget)}
        >
          {/* Floating gradient shimmer */}
          <div className="absolute inset-0 bg-gradient-to-r from-indigo-500/10 via-purple-500/10 to-pink-500/10 opacity-0 group-hover:opacity-100 transition duration-700 blur-2xl" />

          {/* Header */}
          <div className="flex items-start justify-between gap-3">
            <h3 className="text-lg md:text-xl font-semibold text-white/95 tracking-tight group-hover:text-indigo-200 transition">
              {pr.title}
            </h3>
            <ChevronRight className="w-5 h-5 text-white/60 opacity-0 group-hover:opacity-100 group-hover:translate-x-1 transition duration-300" />
          </div>

          {/* Author */}
          <p className="text-sm text-indigo-100/85 mt-2">
            #{pr.number} opened by{" "}
            <span className="font-medium text-indigo-200">
              {pr.user?.login}
            </span>
          </p>

          {/* Labels */}
          {pr.labels?.length > 0 && (
            <div className="mt-3 flex flex-wrap gap-2">
              {pr.labels.map((label) => (
                <span
                  key={label.id}
                  className="px-2.5 py-1 rounded-full text-xs font-medium"
                  style={{
                    backgroundColor: `#${label.color}22`,
                    color: `#${label.color}`,
                    border: `1px solid #${label.color}55`,
                  }}
                >
                  {label.name}
                </span>
              ))}
            </div>
          )}

          {/* Progress shimmer bar */}
          <div className="mt-4 h-1.5 w-full rounded-full bg-white/10 overflow-hidden">
            <div
              className="h-full bg-gradient-to-r from-indigo-400 via-pink-400 to-purple-500 animate-progress"
              style={{
                width: `${Math.min(100, Math.max(15, pr.additions / 5))}%`,
              }}
            />
          </div>

          {/* Actions */}
          <div className="mt-5 flex justify-between items-center gap-3">
            <a
              href={pr.html_url}
              target="_blank"
              rel="noreferrer"
              className="inline-flex items-center gap-2 px-3 py-2 rounded-xl 
                         bg-white/5 border border-white/10 text-white/90 
                         hover:bg-white/15 hover:scale-105 active:scale-95 transition"
            >
              <ExternalLink className="w-4 h-4" />
              View PR
            </a>

            <button
              onClick={() =>
                navigate(`/repos/${owner}/${repo}/prs/${pr.number}`)
              }
              className="px-4 py-2.5 rounded-xl bg-gradient-to-r from-indigo-600 to-purple-600 text-white 
                         shadow-lg hover:scale-[1.05] hover:shadow-xl active:scale-[0.97] transition"
            >
              Details
            </button>
          </div>
        </article>
      ))}
    </section>
  );
}
